import React from "react";
import "./Newsletter.css";
import { Container, Row, Col } from "reactstrap";
import Newsimg from "./../assets/images/newsletter.png";

const Newslatter = () => {
  return (
    <section>
      <Container>
        <Row>
          <Col lg="6">
            <div className="newsletter__content">
              <h2>Subscribe now to get the usefull travel information.</h2>

              <div className="newsletter__input">
                <input type="email" placeholder="Enter your Email" />
                <button className="btn newsletter__btn">Subscribe</button>
              </div>
              <p>
                Lorem ipsum dolor sit amet consectetur adipisicing elit. Placeat
                iusto praesentium consequuntur cumque ex consequatur assumenda
                facere molestiae id quaerat sit tempora, illo iure mollitia
                cupiditate. Cumque deserunt velit inventore.
              </p>
            </div>
          </Col>

          <Col lg="6">
            <div className="newsletter__img">
                <img src={Newsimg} alt="" />
            </div>
          </Col>
        </Row>
      </Container>
    </section>
  );
};

export default Newslatter;
